  posts.map((ele)=>(
    console.log(ele.id),
    console.log(ele.title),
    console.log(ele.timeAndDate),
    console.log(ele.body)
  ))
  return (
    <div className='spacing'>
      {posts.map((post)=>(
        <Postcreation post={post} ></Postcreation>
      ))}
    </div>
    
  )
}

export default Home
